import React, { useState } from "react";
import "./Homepage.css";

export default function HomePage() {
  const [fileUploaded, setFileUploaded] = useState(false);
  const [folderUploaded, setFolderUploaded] = useState(false);
  const [folderContents, setFolderContents] = useState([]);
  const [selectedFiles, setSelectedFiles] = useState([]);
  const [uploadStatus, setUploadStatus] = useState({
    uploaded: false,
    analyzed: false,
    message: "",
    analysisResults: [],
  });
  const [isUploading, setIsUploading] = useState(false);
  const [isAnalyzing, setIsAnalyzing] = useState(false);
  const [analysisPrompt, setAnalysisPrompt] = useState("Detect sensitive data, email addresses, file paths, and URLs in these files.");
  const [fileProgress, setFileProgress] = useState({});

  const CHUNK_SIZE = 1024 * 1024 * 50; // 50MB

  const handleFileUpload = (event) => {
    const files = event.target.files;
    if (files.length > 0) {
      setSelectedFiles(Array.from(files));
      setFileUploaded(true);
      setFolderUploaded(false);
    }
  };

  const handleUploadToBackend = async () => {
    if (selectedFiles.length === 0) {
      alert("No files selected.");
      return;
    }
    setIsUploading(true);
    const sessionId = Date.now().toString();

    try {
      for (const file of selectedFiles) {
        let start = 0;
        while (start < file.size) {
          const chunk = file.slice(start, start + CHUNK_SIZE);
          await uploadChunk(file, start, chunk, sessionId);
          start += CHUNK_SIZE;
        }
        setFileProgress((prevProgress) => ({
          ...prevProgress,
          [file.name]: 100,
        }));
      }

      await fetch("http://localhost:5000/finalize-upload", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ sessionId, files: selectedFiles.map(f => ({ filename: f.name, size: f.size })) }),
      });

      setUploadStatus({ uploaded: true, analyzed: false });
      setIsUploading(false);
      setIsAnalyzing(true);
      analyzeFiles();
    } catch (error) {
      console.error("Upload error:", error);
      setIsUploading(false);
    }
  };

  const analyzeFiles = async () => {
    try {
      const response = await fetch("http://localhost:5000/analyze", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ files: selectedFiles.map(file => file.name), prompt: analysisPrompt })
      });

      const result = await response.json();
      setUploadStatus({ uploaded: true, analyzed: true, analysisResults: result.analysisResults });
      setIsAnalyzing(false);
    } catch (error) {
      console.error("Analysis error:", error);
      setIsAnalyzing(false);
    }
  };

  return (
    <div className="container-homepage">
      <nav className="navbar">HauntAI</nav>
      <div className="upload-container">
        <h2>Upload File</h2>
        <p className="upload-limit">Maximum file size: 1GB</p>
        <input type="file" multiple onChange={handleFileUpload} />
        <textarea 
          placeholder="Enter custom analysis prompt..." 
          value={analysisPrompt} 
          onChange={(e) => setAnalysisPrompt(e.target.value)}
        />
        <button onClick={handleUploadToBackend} disabled={isUploading || isAnalyzing}>
          {isUploading ? "Uploading..." : isAnalyzing ? "Analyzing..." : "Upload"}
        </button>
      </div>

      {selectedFiles.length > 0 && (
        <div className="folder-content-container">
          <h3>Files to be Uploaded:</h3>
          <ul>
            {selectedFiles.map((file, index) => (
              <li key={index}>{file.name} - {fileProgress[file.name] || 0}%</li>
            ))}
          </ul>
        </div>
      )}

      {uploadStatus.analyzed && (
        <div className="analysis-results">
          <h3>Analysis Results</h3>
          <ul>
            {uploadStatus.analysisResults.map((file, index) => (
              <li key={index}>
                <strong>{file.filename}</strong>: {file.reason}
                <button onClick={() => window.open(file.download_url)} style={{ marginLeft: "10px" }}>
                  Download Analysis
                </button>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}
